import { CircularProgressbar, buildStyles } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';

function Body () {

    const value = 0.66;



    return (
        <>

        <div className="bg-secondary5 min-h-screen flex">
            {/* PDF */}
            <div className="flex-grow flex justify-center">
                <div className="flex flex-col justify-center items-center w-pdf-w h-pdf-h mt-4 bg-white shadow-lg ">
                    <h1 className="text-2xl font-bold text-primary">NOT-A-PDF.pdf</h1>
                    <h1 className="text-2xl font-bold text-primary">NOT-A-PDF.pdf</h1>
                    <h1 className="text-2xl font-bold text-primary">NOT-A-PDF.pdf</h1>
                </div>
            </div>

            {/* Sidebar */}
            <div className="flex justify-center w-64 bg-white">
                <div className="flex flex-col">
                    <h1 className="mt-5 text-xl font-bold">Dashboard</h1>

                    {/* Mini Dashboard */}
                    <div className="mt-5 bg-white w-52 h-32 rounded-lg shadow-md border border-primary-2">
                        <div className="flex flex-grow justify-between ">
                            {/* Left Dashboard */}
                            <div className="flex flex-col">
                                <h1 className="mt-6 ml-3 font-bold text-left">✅&nbsp;&nbsp;&nbsp;8/12</h1>
                                <h1 className="mt-1 ml-3 font-bold text-left">❌&nbsp;&nbsp;&nbsp;3/12</h1>
                                <h1 className="mt-1 ml-3 font-bold text-left">❓&nbsp;&nbsp;&nbsp;1/12</h1>
                            </div> 
                            {/* Right Dashboard */}
                            <div>
                                <div>
                                    <h1 className="mt-3 ml-3 text-sm font-bold"> Score</h1>
                                </div>
                                {/* Progressbar */}
                                <div className="mt-1 mr-3 " style={{ width: 70, height: 70}}>
                                    <CircularProgressbar 
                                    styles={buildStyles({ pathColor:'#1A56DB', textColor:'#000000' })}
                                    value={value} maxValue={1} text={`${value * 100}%`} 
                                    />
                                </div>
                            </div>

                        </div>
                    </div>  

                </div>
            </div>
        </div>

        </>
    )
}

export default Body;
